INSERT INTO my_about VALUES ('5','Introduction to the Site','<p style=\"text-align:left;\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;font-size:18pt;\"> <span style=\"color:#337FE5;\"> </span> <span style=\"color:#4C33E5;line-height:1;font-size:24px;font-family:Tahoma;\">Introduction to Ezi2u.com.my</span><span></span></span></b>\r\n</p>\r\n<p style=\"text-align:left;\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;font-size:18pt;\"><span></span></span></b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">Ezi2u.com provides vast amount of information about&nbsp; almost everything in life for users from all parts of Malaysia. Searching,</span> \r\n</p>\r\n<p style=\"text-align:left;\" align=\"left\">\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">viewing and posting information are for free with our platforms on PC as well as portable digital devices (Cell phone, Ipad, etc.). </span> \r\n</p>\r\n<p style=\"text-align:left;\" align=\"left\">\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">In addition, sellers are able to register to enjoy a free shop page, free services on posting products and ordering. We have also </span> \r\n</p>\r\n<p style=\"text-align:left;\" align=\"left\">\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">a number of advertisement spaces covering nearly any area on our web page for sellers to put imaged ads.</span> \r\n</p>\r\n<p style=\"text-align:left;\" align=\"left\">\r\n	<br />\r\n<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span><b><span style=\"color:red;font-size:12pt;\"></span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18pt;\"> <strong><span style=\"color:#4C33E5;line-height:1;font-size:24px;font-family:Tahoma;\">Instruction on Costs and</span><span style=\"color:#4C33E5;\"> </span><span style=\"color:#4C33E5;line-height:1;font-size:24px;font-family:Tahoma;\"> Earnings for Members</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18pt;\"><strong><span style=\"color:#4C33E5;line-height:1.5;font-size:18px;\"></span></strong></span><span style=\"font-family:Tahoma;\"></span><br />\r\n<b><span style=\"color:#000000;line-height:1;font-size:18px;font-family:Tahoma;\"><span style=\"color:#666666;\">1. Earning Scores and Coins</span><br />\r\n<br />\r\n</span></b> \r\n</p>\r\n<span style=\"font-size:18px;\">(1) Upon registration (either as individual or as seller member), a registered member will be ranked Visitor and awarded 10 scores and 20 coins;</span><br />\r\n<span style=\"font-size:18px;\">(2) Upon successful posting of either a post or a product, a registered member earns 2 scores;</span><br />\r\n<span style=\"font-size:18px;\">(3) Upon each successful log-in, a registered member earns 1 score;</span><br />\r\n<span style=\"font-size:18px;\">(4) Upon passing verification of either the ID or the Business Licence, a registered member earns 10 scores;</span><br />\r\n<span style=\"font-size:18px;\">(5) 10 scores can be exchanged for a coin;</span><br />\r\n<span style=\"font-size:18px;\">(6) Members\' coins can be used for payment of services of the site;</span><br />\r\n<span style=\"font-size:18px;\">(7) 1 RM can purchase 1 coin, and registered member can log-in and purchase coins online (This function is yet to complete, and now members can contact us via phone to purchase coins);</span><br />\r\n<span style=\"font-size:18px;\">(8) Members\' coins cannot be exchanged for RM. </span><br />\r\n<p>\r\n	<br />\r\n<b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">2. Coin Consumption</span></b> \r\n</p>\r\n<p>\r\n	<b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span></b><br />\r\n<span style=\"font-size:12pt;\"> <strong> </strong><strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">1) Costs for Member Rank Upgrading</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"> </span><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">(1) From Visitor to Normal Member:</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:14px;\"></span><br />\r\n<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> For 1 month:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;2 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"> </span><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">For 6 months:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> For 1 year:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 18 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"> </span><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">Permanently:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;99 coins.</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;font-size:14px;\"></span><br />\r\n<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> (2) From Normal Member to Gold Member:</span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:14px;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"> </span><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> <span style=\"line-height:1;\">For 1 month:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;3 coins;</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span><span style=\"font-size:18px;line-height:1;\">For 6 months:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 16 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span><span style=\"font-size:18px;line-height:1;\">For 1 year:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 30 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span><span style=\"font-size:18px;line-height:1;\">Permanently:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 188 coins.</span><br />\r\n<br />\r\n<b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">2) Costs on Modifying Posts:</span></span></b> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;line-height:1;\">Place at the Top of the Homepage:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 4 Coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;line-height:1;\">Place at the Top of the Broad Headings:&nbsp;&nbsp; 2 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;line-height:1;\">Place at the Top of the Sub-headings: &nbsp;&nbsp;&nbsp;&nbsp; 1 coin;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><span style=\"line-height:1;\">Reddening/Over-striking Post Title:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 coin;</span><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span><span style=\"font-size:18px;line-height:1;\">Refreshing:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 coin.</span><br />\r\n<b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span></span></b> \r\n</p>\r\n<p>\r\n	<br />\r\n<span> <span style=\"line-height:1;font-family:Tahoma;font-size:18px;\"></span></span> <b><span style=\"font-size:15pt;\"></span></b><span></span> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:15pt;\"> <span style=\"color:#003399;\"> </span><span style=\"color:#4C33E5;line-height:1;font-size:24px;font-family:Tahoma;\">Rights of Registered Members&nbsp; on Ezi2u.com</span></span></b><br />\r\n<br />\r\n<span style=\"font-size:12pt;\"><strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> 1)</span></strong><strong> </strong><strong><span style=\"color:#009900;line-height:1;font-size:18px;font-family:Tahoma;\">Visitor:</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"><strong><span style=\"font-size:14px;\"></span></strong><b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> free posting &amp; managing posts, </span></b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">choice of topping &amp;refreshing posts,</span><b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> earning scores upon posting &amp; logging-in;</span></b></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"><b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span></b></span><br />\r\n<span style=\"font-size:12pt;\"><strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> 2) </span></strong><strong><span style=\"color:#009900;line-height:1;font-size:18px;font-family:Tahoma;\">Normal Member:</span></strong><b> </b></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">f</span></span><span style=\"font-size:12pt;\"><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">ree posting &amp; managing posts,</span><b> </b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">choice of topping &amp; refreshing posts,</span><b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> shop page (for sellers), </span></b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">choice of uploading&nbsp; information for shop page such as images,</span><b><span style=\"font-size:14px;\"></span></b></span><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> earning scores upon posting &amp; logging-in;</span></b></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><br />\r\n</span></b></span> \r\n</p>\r\n<span style=\"font-size:12pt;\"> \r\n<p>\r\n	<strong> <span style=\"color:#009900;line-height:1;font-size:18px;font-family:Tahoma;\">3)Gold Member</span><span style=\"color:#009900;line-height:1;font-size:18px;font-family:Tahoma;\">:</span></strong> \r\n</p>\r\n<p>\r\n	<strong><span style=\"color:#000000;font-size:14px;\"></span></strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">free posting &amp; managing posts,</span><b> </b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">choice of topping &amp; refreshing posts,</span><b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> shop page (for sellers), </span></b><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">choice of uploading information for shop page such as images,</span><strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> free posting about products, earning scores upon posting &amp;logging-in.</span></strong> \r\n</p>\r\n<p>\r\n	<strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><br />\r\n</span></strong> \r\n</p>\r\n<b> \r\n<p>\r\n	<span style=\"font-size:12pt;\"> </span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> <span style=\"color:#EE33EE;line-height:1;font-size:18px;font-family:Tahoma;\">P</span></span><span style=\"color:#EE33EE;line-height:1;font-size:18px;font-family:Tahoma;\">lease Note: Due to the fact that we are consistently bettering ourselves, all terms shown in this introduction may subject</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;line-height:1;font-size:18px;font-family:Tahoma;\"> to change, and ezi2u.com reserves the rights to explain these terms.</span> \r\n</p>\r\n</b> \r\n<p>\r\n	<br />\r\n</p>\r\n</span> \r\n<p>\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\">2015/11/03</span> \r\n</p>\r\n<span style=\"font-size:12pt;\"> \r\n<p>\r\n	<br />\r\n</p>\r\n<span> \r\n<p>\r\n	<br />\r\n</p>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:-60.25pt;margin-left:60.25pt;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:-60.25pt;margin-left:60.25pt;\">\r\n	<span style=\"font-size:12pt;\"><span> </span></span> \r\n</p>\r\n<p>\r\n	<span></span> \r\n</p>','0','0','2','Introduction-to-the-Site');
INSERT INTO my_about VALUES ('6','Introduction to Advertise','<span style=\"color:#4C33E5;font-size:24px;\"><b><span style=\"font-size:12pt;\"> \r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Dear\r\n users, our site helps you find and post information concerning almost \r\neverything in your life, a</span></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">ll free of charge, and we also have free shop \r\npage, product display and ordering service in store especially </span></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">for \r\nregistered seller members!</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p>\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In order to express our gratitude to those who registered, all registered users (members) will receive </span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">a gift of 20 coins once the registration is complete. (It takes 1 RM to buy 1 Coin)</span> \r\n</p>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>\r\n</b> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>','2','0','2','Introduction-to-Advertise');
