INSERT INTO my_faq VALUES ('3','1','On User ID','1.Your User ID&nbsp;is your ID on&nbsp;this site. Every member has a unique <span>User ID</span> to distinguish him/her from the others. Your <span>User ID </span>will also be seen in all of your posts. We recommend that you choose a <span>User ID </span>that is liked and easily remembered by you, for at present, <span>User IDs </span>can not be changed. <br />\r\n<br />\r\n2. Once registered with a user ID, you become a visitor member. this member level enables you to make and manage posts.<br />\r\n<br />\r\n<p>\r\n	3. A visitor member can be upguaded to normal and gold member. Once upgraded, the account enjoys more privilege.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	4. For seller members, once the account is upgraded to normal or gold member, it instantly enjoys its own shop homepage and is able to make post on goods and coupons.\r\n</p>');
INSERT INTO my_faq VALUES ('22','2','Certification Process','1. Certification is a process requiring registered members to upload their relative documents in order to be verified to be trustworthy.<br />\r\n<br />\r\n2. Only registered member accounts are allowed to be certified. To be certified a registered member needs to upload an image of his/her ID (for individual member) or the licence or certificate of the company (for seller member) for the staff of the site to verify. The verification process takes 3 working days.<br />\r\n<br />\r\n3. Once a member account passes the verification, a label <img src=\"data:image/png;base64,\" alt=\"\" />will appear beside the icon and name of the member denoting its trustworthyness and the member will be a certified member to the site. Such an identity could bring the account more opportunities of business.<br />\r\n<br />');
INSERT INTO my_faq VALUES ('26','5','Topping Posts','<p>\r\n	1. For a successfully made post, the post maker can choose to top it. Once topped, the post will, for a certain (selected) period, stay among the top few in the category list with an eye-catching mark.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	2. There are 3 forms of topping: topping on homepage, topping on broad headings and topping on sub-headings.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	3. Topping helps keeping the post in an eye-catching position as it stops the post from being pushed below by newer posts. Therefore, it brings more opportunities of business.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	4. Topping post is a value-added service and requires extra charges.\r\n</p>');
INSERT INTO my_faq VALUES ('27','5','Refreshing Post','<p>\r\n	1. Refreshing a post is, to some extent, remaking the post. Once refreshed, a pushed-below post can be placed at the top few of the list once more.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	2. Refreshing post is a value-added service and requires extra charges.\r\n</p>');
INSERT INTO my_faq VALUES ('34','4','Undisplayed Posts','<div>\r\n	1. If the post contains illegal, pornographic, or other improper content that doesn\'t abide by the rules of our site, it will be put under revision by the system and will not be shown. Should you have any quesyions, please contact our staff.\r\n</div>\r\n<div>\r\n</div>\r\n<div>\r\n	2. Sometimes, the text content of a post may be displayed but not the image content. This is usually the result of bad network connection (when uploading an image) and/or oversized image. We recommend that you retry to upload images in an environment with fast and stable network and always keep the size of image smaller than 1MB.\r\n</div>\r\n<div>\r\n</div>');
INSERT INTO my_faq VALUES ('36','6','Further Questions','<p>\r\n	Ezi2u.com will always be looking forward to any of your suggesstions as well as inquiries.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	If you have any good advice or wish to know more about our site, do feel free to contact us via our Email address: <span style=\"line-height:1.5;font-size:18px;\"><span style=\"font-size:18px;\"><br />\r\n</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;font-size:18px;\"><span style=\"font-size:18px;\"><br />\r\n</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1.5;font-size:18px;color:#4C33E5;\"><span style=\"font-size:18px;color:#4C33E5;\"><span style=\"color:#000000;\"><strong>eziu.info@gmail.com</strong></span><span style=\"background-color:#00D5FF;\"></span></span></span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	We will be very happy on hearing from you!\r\n</p>');
