INSERT INTO my_information VALUES ('246','Pulau Rawa','270','1442162174','0','0','JB，麻坡的朋友们，如果要去漂亮的海岛，不用再驾车7-8小时北上了。这个与世无争的小岛就近在眼前，在mersing码头再坐半小时的船就到了。<br />\r\n这里真的太漂亮了，而且也不会坐船到别边去浮浅，因为resort前就有千万只的鱼，真的是千万只噢，有图为证，嘿嘿。。<br />\r\n这里也是苏丹家族的私人岛，那天还有幸不小心跟苏丹一起看海，只是没敢跟他合照，哈哈。<br />\r\n这里也有座小山，还有只小狗陪我们爬上去，山上的景色也是一级棒，可以看完四周围的海，也可以看夕阳。<br />\r\n还有就是这里的沙，简直就是又白又幼到无法形容。最后当然是这里的海，真真真的是太棒了。。<br />\r\n里头有很多自拍照，看不惯者请回避，哈哈。。<br />\r\n<br />\r\n(由于很多大大inbox我问关于pulau&nbsp;rawa的问题，不好意思没办法一一回复，不过我在这里写给大家我所知道的吧。）<br />\r\n岛上只有两个resort。<br />\r\n如果你是想住好吃好的，你可以选择www.rawaislandresort.com<br />\r\n这里有aircond有电视之类的设备，也适合一家大小。<br />\r\n但是如果你想感受大自然，你可以选择www.alangsrawa.com<br />\r\n这里没有电视没有aircond，只有跟大自然连接的小板屋，要住得好的人，这间就不适合你。我是住这间。价钱网站里都有。<br />\r\n然后从哪里去？怎样去？多久会到？这个你们就要问google了，哈哈。我从麻坡出发，慢慢驾车3小时就到码头。<br />\r\n最后，希望大家不要问跟我公司去要多少钱了。因为我不是旅行社，也不是导游，我只是一个把漂亮地方跟大家分享的旅者。。<br />\r\nJB,&nbsp;Muar&nbsp;friends,&nbsp;If&nbsp;you&nbsp;go&nbsp;to&nbsp;a&nbsp;beautiful&nbsp;island,&nbsp;do&nbsp;not&nbsp;drive&nbsp;7-8&nbsp;hours&nbsp;northward.&nbsp;The&nbsp;insular&nbsp;island&nbsp;on&nbsp;sight,&nbsp;sit&nbsp;a&nbsp;half-hour&nbsp;boat&nbsp;dock&nbsp;in&nbsp;mersing&nbsp;to&nbsp;go.<br />\r\nHere&nbsp;is&nbsp;really&nbsp;too&nbsp;pretty,&nbsp;but&nbsp;it&nbsp;will&nbsp;not&nbsp;go&nbsp;snorkeling&nbsp;boat&nbsp;to&nbsp;the&nbsp;other&nbsp;side,&nbsp;because&nbsp;there&nbsp;are&nbsp;millions&nbsp;of&nbsp;former&nbsp;resort&nbsp;only&nbsp;fish,&nbsp;really&nbsp;do&nbsp;just&nbsp;oh,&nbsp;there&nbsp;is&nbsp;photo&nbsp;evidence,&nbsp;hehe.&nbsp;ʱ??<br />\r\nHere&nbsp;is&nbsp;the&nbsp;private&nbsp;island&nbsp;of&nbsp;Sudan&nbsp;family&nbsp;day&nbsp;also&nbsp;had&nbsp;the&nbsp;privilege&nbsp;to&nbsp;see&nbsp;the&nbsp;sea&nbsp;careless&nbsp;together&nbsp;with&nbsp;Sudan,&nbsp;but&nbsp;did&nbsp;not&nbsp;dare&nbsp;pictured&nbsp;with&nbsp;him,&nbsp;ha&nbsp;ha.<br />\r\nThere&nbsp;is&nbsp;also&nbsp;a&nbsp;hill,&nbsp;there&nbsp;are&nbsp;puppies&nbsp;accompany&nbsp;us&nbsp;to&nbsp;climb,&nbsp;the&nbsp;mountain&nbsp;scenery&nbsp;is&nbsp;beautifully&nbsp;surrounded&nbsp;by&nbsp;the&nbsp;sea&nbsp;can&nbsp;read,&nbsp;you&nbsp;can&nbsp;also&nbsp;watch&nbsp;the&nbsp;sunset.<br />\r\nThere&nbsp;is&nbsp;sand&nbsp;here,&nbsp;is&nbsp;simply&nbsp;white&nbsp;and&nbsp;immature&nbsp;to&nbsp;unspeakable.&nbsp;Finally,&nbsp;of&nbsp;course,&nbsp;is&nbsp;where&nbsp;the&nbsp;sea,&nbsp;Barbara&nbsp;is&nbsp;really&nbsp;fantastic.&nbsp;ʱ??<br />\r\nThere&nbsp;are&nbsp;many&nbsp;pictures&nbsp;from&nbsp;inside,&nbsp;could&nbsp;not&nbsp;understand,&nbsp;please&nbsp;avoid,&nbsp;ha&nbsp;ha.&nbsp;ʱ??<br />\r\n<br />\r\n(As&nbsp;many&nbsp;greatly&nbsp;inbox&nbsp;pulau&nbsp;rawa&nbsp;I&nbsp;asked&nbsp;about&nbsp;the&nbsp;issue,&nbsp;sorry&nbsp;no&nbsp;way&nbsp;to&nbsp;respond&nbsp;to,&nbsp;but&nbsp;I\'m&nbsp;here&nbsp;I&nbsp;know&nbsp;you&nbsp;wrote&nbsp;it.)<br />\r\nThe&nbsp;island&nbsp;has&nbsp;only&nbsp;two&nbsp;resort.<br />\r\nIf&nbsp;you&nbsp;want&nbsp;to&nbsp;live&nbsp;a&nbsp;good&nbsp;taste,&nbsp;you&nbsp;can&nbsp;choose&nbsp;www.rawaislandresort.com<br />\r\nThere&nbsp;is&nbsp;aircond&nbsp;devices&nbsp;like&nbsp;TV,&nbsp;but&nbsp;also&nbsp;for&nbsp;the&nbsp;whole&nbsp;family.<br />\r\nBut&nbsp;if&nbsp;you&nbsp;want&nbsp;to&nbsp;experience&nbsp;nature,&nbsp;you&nbsp;can&nbsp;choose&nbsp;www.alangsrawa.com<br />\r\nThere&nbsp;is&nbsp;no&nbsp;TV&nbsp;no&nbsp;aircond,&nbsp;only&nbsp;a&nbsp;small&nbsp;Itaya&nbsp;connection&nbsp;with&nbsp;nature,&nbsp;people&nbsp;want&nbsp;to&nbsp;live&nbsp;well,&nbsp;this&nbsp;is&nbsp;not&nbsp;for&nbsp;you.&nbsp;I&nbsp;live&nbsp;this.&nbsp;Prices&nbsp;sites&nbsp;are&nbsp;limitless.<br />\r\nThen&nbsp;go&nbsp;where?&nbsp;How&nbsp;to&nbsp;go?&nbsp;How&nbsp;long&nbsp;it&nbsp;will&nbsp;go&nbsp;to?&nbsp;This&nbsp;you&nbsp;have&nbsp;to&nbsp;ask&nbsp;google,&nbsp;ha&nbsp;ha.&nbsp;My&nbsp;departure&nbsp;from&nbsp;Muar,&nbsp;slowly&nbsp;driving&nbsp;three&nbsp;hours&nbsp;on&nbsp;the&nbsp;pier.<br />\r\nFinally,&nbsp;I&nbsp;hope&nbsp;you&nbsp;do&nbsp;not&nbsp;ask&nbsp;me&nbsp;how&nbsp;much&nbsp;money&nbsp;the&nbsp;company&nbsp;went.&nbsp;Because&nbsp;I&nbsp;am&nbsp;not&nbsp;a&nbsp;travel&nbsp;agency,&nbsp;nor&nbsp;is&nbsp;a&nbsp;guide,&nbsp;I\'m&nbsp;just&nbsp;a&nbsp;nice&nbsp;place&nbsp;to&nbsp;share&nbsp;with&nbsp;you&nbsp;the&nbsp;traveler.&nbsp;ʱ??','','Pure Value','','enquiry@purevalue.com.my','60197534250 / 6077996811','0','20','0','e10adc3949ba59abbe56e057f20f883e','219.92.255.4','马来西亚','1','/attachment/information/201509/pre_1441847720icnqx.jpg','4','1','0','1','0','0','0','0','Tour','Tour','1','0','','','1','11','0');
