INSERT INTO my_news VALUES ('3','1','','1','0','','Ezi2u.com Test Run Started!','ezi2u.com','1','1441869911','The Test Run of Ezi2u.com Has Started!','<p>\r\n	<span style=\"color:#009900;\"><span style=\"color:#006600;\">Thanks to our hard-working staff, the test run of ezi2u.com has now started!</span></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#009900;\"><span style=\"color:#006600;\"><br />\r\n</span></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#009900;\"><span style=\"color:#006600;\">We welcome you all to take part in our test run, trying every function out and will always be expecting feedback!</span></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#006600;\"><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#006600;\">If you have anything to tell us about our site, feel free to contact us via</span>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"color:#006600;\"></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#006600;\"><span style=\"line-height:1.5;font-size:18px;\"><span style=\"font-size:18px;\"><strong>eziu.info@gmail.com</strong></span></span><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#006600;\"><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#006600;\">And don\'t forget to keep track of our progress, as we can\'t wait to present you this all-round website dedicated to make your life easier in Malaysia!</span><br />\r\n<span style=\"color:#009900;\"><span style=\"color:#006600;\"></span><span style=\"color:#006600;\"></span></span><span style=\"color:#009900;\"></span> \r\n</p>','EZI2U Admin','EZI2U','200','23','','','0');
