  KEY userid (userid),
  KEY areaid (areaid),
  KEY catid (catid),
  KEY levelid (levelid),
  KEY if_corp (if_corp),
  KEY jointime (jointime),
  KEY ifindex (ifindex),
  KEY iflist (iflist),
  KEY openid (openid),
  KEY cityid (cityid)
) ENGINE=MyISAM AUTO_INCREMENT=72 DEFAULT CHARSET=utf8 AUTO_INCREMENT=72;


